INSERT INTO `degree` VALUES ('Bachelor of Computer Science','Our Bachelor of Computer Science features artificial intelligence and machine learning courses not available anywhere else in South Australia. It??s taught by world-class researchers and teachers within a faculty?ranked 40 in the world for computer science and engineering*.'),('Bachelor of Computer Science Advanced','Our Bachelor of Computer Science (Advanced) is a distinctive degree for highly capable students who want to tackle global questions in computer science and information technology.'),('Bachelor of Information Technology','The degree is taught within a faculty?ranked 48 in the world for computer science and engineering^. Leveraging the University??s strong industry links and world-class research, it features an emphasis on systems and business approaches, and design thinking. Majors are offered in either Cyber Security or Artificial Intelligence and Machine Learning.'),('Master of Cyber Security','Our Master of Cyber Security will equip you to lead cutting-edge cyber security programs ??for governments, law enforcement agencies, companies and NGOs alike.'),('Master of Computing and Innovation','Our Master of Computing and Innovation is designed to build the communication, project management and innovation skills needed to thrive in a growing industry.'),('Master of Artificial Intelligence and Machine Learning','Our Master of Artificial Intelligence and Machine Learning is driven by AIML??s cutting-edge research and extensive industry links, spanning diverse international sectors ?C from health, medical technology, defence and security to environment and natural resources.'),('Master of Computer Science','Our Master of Computer Science has a major research component and projects are supervised by leading academics from world-class research groups. Their fields of expertise include computer vision, evolutionary computation, distributed systems, computer networks, high-performance computing, formal verification and systems modelling.');
/*!40000 ALTER TABLE `degree` ENABLE KEYS */;
